import React from 'react';
import './message.css';

const Message =(props)=>{

    
        return (
            <div className='message-item'>
                <div><b>{props.senderName}</b></div>
                <span>{props.text}</span>
                <br></br>
                <span  className="activeTime">32 mins ago</span>
            </div>
        )
    
}
export default Message;
